  true,\n\t\"url\": null,\n\t\"notes\": \"GLAH13 contains sea ice and open ocean elevations
  corrected for geodetic and atmospheric affects, calculated from algorithms fine-tuned
  for sea ice returns. Granules contain 14 orbits of data within a sea ice mask. (Suggested
  Usage: GLAH13 contains sea ice, open ocean, and iceberg elevations corrected for
  geodetic and atmospheric affects, calculated from algorithms fine-tuned for sea
  ice returns. Granules contain 14 orbits of data within the sea ice mask. Each GLAH13
  file was created from an equivalent GLA13 binary file. The data used to create the
  GLAH13 values are contained in the equivalent GLAHxx files for the GLAxx files.
  See the provenance metadata for the creation of the GLA13.)\",\n\t\"license_title\":
